import React from "react";
import { Link } from "react-router-dom";
import "../App.css";
import { Container, Menu } from "semantic-ui-react";

const Nav = () => (
  <Menu fixed="top" inverted color="teal" tertiary>
    <Container>
      <Menu.Item as={Link} to="/" name="home">
        NEW NEW PROJECT
      </Menu.Item>
      <Menu.Item as={Link} to="/logIn" name="logIn">
        LogIn
      </Menu.Item>
      <Menu.Item as={Link} to="/signup" name="signup">
        SignUp
      </Menu.Item>
      <Menu.Item as={Link} to="/project" name="projects">
        Projects
      </Menu.Item>
    </Container>
  </Menu>
);

export default Nav;
